import React from 'react';
import PropTypes from 'prop-types';
import ReactDOM from 'react-dom';

class Header extends React.Component {

    static propTypes = {
        name: PropTypes.string.isRequired
    };

    render() {
        return (
            <div>
                <h1>{this.props.name}</h1>
            </div>
        )
    }
}

export default Header;
